import styled from 'styled-components'

const Footer = styled.footer`
  width: 100%;
  margin-top: 20px;
  h2{
    color:#CCD6F6;
    font-weight: 400;
    font-size: 36px;
    margin-top: 0;
    margin-bottom: 22px;
  }
`

export default Footer
